import React from 'react'
import './Contents.css';


export default function Contents() {
  return (
      <div className='form'>
        <div className='sign-up'>회원가입</div>
        <div className='id'>
            <label>아이디 *</label>
             <input className='id-line' 
             placeholder='아이디를 입력해주세요'/>
             </div>

      </div>
      )
}
